#include <bits/stdc++.h>

using namespace std;

// Complete the isValid function below.
string isValid(string s) {

    std::map<char,int> freq;
    std::map<int,int> count;    

if(s.length())
{
    for(auto& at: s)
    {
        auto res = freq.insert({at,1});
        if(res.second == false)
        {
            freq.at(at)++;
        }
    }
    
    for(auto& at_r : freq)
    {        
        auto res = count.insert({at_r.second, 1});   
        if(res.second ==false)
        {
            count.at(at_r.second)++;
        }
        //cout<<at_r.first<<" : "<<at_r.second<<endl;
    }
    
    if(count.size() == 1)
    {
        return "YES";
    }
    
    if(count.size() > 2)
    {
        return "NO";
    }
    if(count.size() == 2)
    {
        auto at = count.begin();
        auto at1 = count.begin();
        at++;
       // cout<<at1->first<<" "<<at->first<<endl;
       // cout<<at1->second<<" "<<at->second<<endl;
        if(at1->first == 1)
        {
            if(at1->second == 1)
            return "YES";  
        }
        if((at->first - at1->first) == 1)
        {
            if(at->second ==1 || at1->second == 1)
                return "YES";            
        }
    }
    
    return "NO";
}
return "YES";
}

int main()
{


    string result = isValid("");

    
    cout << result << "\n";
    result = isValid("abc");
    cout << result << "\n";
    result = isValid("abcc");
    cout << result << "\n";
    result = isValid("abccc");
    cout << result << "\n";
    result = isValid("aabbccddeefghi");
    cout << result << "\n";
    result = isValid("abcdefghhgfedecba");
    cout << result << "\n";
    result = isValid("abbac");
    cout << result << "\n";


    return 0;
}
